import AboutMe from './components/AboutMe';
import Contact from './components/Contact';
import Information from './components/Information';
import Menu from './components/Menu';
import Projets from './components/Projets';
function App() {
  return (
    <>
    <Menu/>
    <AboutMe/>
    <Information/>
    <Projets/>
    <Contact/>
    <Footer/>
    </>
  );
}

export default App;
